def _login(self):
    useremail, password = self._get_login_info()
    if useremail is None:
        return
    login_page_req = compat_urllib_request.Request(self._LOGIN_URL)
    login_page_req.add_header('Cookie', 'locale=en_US')
    login_page = self._download_webpage(login_page_req, None, note='Downloading login page', errnote='Unable to download login page')
    lsd = self._search_regex('<input type="hidden" name="lsd" value="([^"]*)"', login_page, 'lsd')
    lgnrnd = self._search_regex('name="lgnrnd" value="([^"]*?)"', login_page, 'lgnrnd')
    login_form = {'email': useremail, 'pass': password, 'lsd': lsd, 'lgnrnd': lgnrnd, 'next': 'http://facebook.com/home.php', 'default_persistent': '0', 'legacy_return': '1', 'timezone': '-60', 'trynum': '1'}
    request = compat_urllib_request.Request(self._LOGIN_URL, urlencode_postdata(login_form))
    request.add_header('Content-Type', 'application/x-www-form-urlencoded')
    try:
        login_results = self._download_webpage(request, None, note='Logging in', errnote='unable to fetch login page')
        if re.search('<form(.*)name="login"(.*)</form>', login_results) is not None:
            self._downloader.report_warning('unable to log in: bad username/password, or exceded login rate limit (~3/min). Check credentials or wait.')
            return
        check_form = {'fb_dtsg': self._search_regex('name="fb_dtsg" value="(.+?)"', login_results, 'fb_dtsg'), 'h': self._search_regex('name="h"\\s+(?:\\w+="[^"]+"\\s+)*?value="([^"]+)"', login_results, 'h'), 'name_action_selected': 'dont_save'}
        check_req = compat_urllib_request.Request(self._CHECKPOINT_URL, urlencode_postdata(check_form))
        check_req.add_header('Content-Type', 'application/x-www-form-urlencoded')
        check_response = self._download_webpage(check_req, None, note='Confirming login')
        if re.search('id="checkpointSubmitButton"', check_response) is not None:
            self._downloader.report_warning('Unable to confirm login, you have to login in your brower and authorize the login.')
    except (compat_urllib_error.URLError, compat_http_client.HTTPException, socket.error) as err:
        self._downloader.report_warning('unable to log in: %s' % compat_str(err))
        return

def _real_extract(self, url):
    mobj = re.match(self._VALID_URL, url)
    video_id = mobj.group('id')
    url = 'https://www.facebook.com/video/video.php?v=%s' % video_id
    webpage = self._download_webpage(url, video_id)
    BEFORE = '{swf.addParam(param[0], param[1]);});\n'
    AFTER = '.forEach(function(variable) {swf.addVariable(variable[0], variable[1]);});'
    m = re.search(re.escape(BEFORE) + '(.*?)' + re.escape(AFTER), webpage)
    if not m:
        m_msg = re.search('class="[^"]*uiInterstitialContent[^"]*"><div>(.*?)</div>', webpage)
        if m_msg is not None:
            raise ExtractorError('The video is not available, Facebook said: "%s"' % m_msg.group(1), expected=True)
        else:
            raise ExtractorError('Cannot parse data')
    data = dict(json.loads(m.group(1)))
    params_raw = compat_urllib_parse.unquote(data['params'])
    params = json.loads(params_raw)
    video_data = params['video_data'][0]
    video_url = video_data.get('hd_src')
    if not video_url:
        video_url = video_data['sd_src']
    if not video_url:
        raise ExtractorError('Cannot find video URL')
    video_title = self._html_search_regex('<h2 class="uiHeaderTitle">([^<]*)</h2>', webpage, 'title', fatal=False)
    if not video_title:
        video_title = self._html_search_regex('(?s)<span class="fbPhotosPhotoCaption".*?id="fbPhotoPageCaption"><span class="hasCaption">(.*?)</span>', webpage, 'alternative title', default=None)
        if len(video_title) > 80 + 3:
            video_title = video_title[:80] + '...'
    if not video_title:
        video_title = 'Facebook video #%s' % video_id
    return {'id': video_id, 'title': video_title, 'url': video_url, 'duration': int(video_data['video_duration']), 'thumbnail': video_data['thumbnail_src']}

